import React from "react";
import "../../Styles/Shared/MyButton.scss";

function MyButton({ name, className, icon, img }) {
  return (
    <button className={`${className} myButton`}>
      <img src={img} alt='' />
      {icon}
      {name}
    </button>
  );
}

export default MyButton;
